pragma solidity >=0.4.22 <0.6.0;
contract ApplicationSign {
    address public owner;

    constructor() public{
        owner = msg.sender;
    }

    struct student {
        address self;
        address parent;
        address tg;
    }

    struct tg {
        address self;
        string subject;
    }

    struct parent {
        address self;
        string contact;
    }

    struct hod {
        address self;
        string dept;
    }

    struct application {
        address student;
        address tg;
        bool status_parent;
        bool status_tg;
        bool status_hod;
        string details;
        string doc_hash;
    }

    modifier parentApproved(uint _id){
        require(applications[_id].status_parent == true);
        _;
    }

    modifier tgApproved(uint _id){
        require(applications[_id].status_tg == true);
        _;
    }

    event ApplicationCreate(uint applicaion, bool status);

    mapping(uint => application) public applications;

    mapping(address => tg) public tgs;
    mapping(address => hod) public hods;
    mapping(address => student) public students;
    mapping(address => parent) public parents;

    uint public count ;

    function create_hod(address _hodadd, string memory _dept) public{
        hod memory _hod = hod(_hodadd, _dept);
        hods[msg.sender] = _hod;
    }

    function get_application(uint _id) public view returns(address _tg, bool _status_parent, bool _status_tg,bool _status_hod, string memory _details,string memory _doc_hash){
       return (applications[_id].tg, applications[_id].status_parent, applications[_id].status_tg, applications[_id].status_hod, applications[_id].details, applications[_id].doc_hash);
   }

    function create_tg(address _tgadd ,string memory subject) public{
        tg memory _tg = tg(_tgadd, subject);
        tgs[msg.sender] = _tg;
    }

    function create_student(address _studentadd ,address _parent, address _tg) public{
        student memory _student = student(_studentadd, _parent, _tg);
        students[msg.sender] = _student;
    }

    function create_parent(address _parentadd, string memory contact) public{
        parent memory _parent = parent(_parentadd, contact);
        parents[msg.sender] = _parent;
    }

    function new_application(string memory _details, string memory _dochash) public {
        uint _id = count;
        address _tg = students[msg.sender].tg;
        applications[_id] = application(msg.sender, _tg, false,false,false, _details, _dochash);
        count +=1;
        emit ApplicationCreate(_id, false);
    }

    function approveParent(uint _id) public{
        applications[_id].status_parent = true;
    }

    function approveTg(uint _id) parentApproved(_id) public{
        applications[_id].status_tg = true;
    }

    function approveHod(uint _id) tgApproved(_id) public{
        applications[_id].status_hod = true;
    }
}
